class Main {

	public static void main(String[] args) {
		String key1 = "";
		String key2 = "";
		String key3 = "";
		String key4 = "";
		String key5 = "";
		String[] keys = new String[]{key1, key2, key3, key4, key5};

		char[] code = new char[keys.length];
		for (int i=0; i<keys.length; i++) {
			//code[i] = findKey1(keys[i]);
			code[i] = findKey2(keys[i]);
		}
		for (char num : code) {
			System.out.print(num);
		}
		System.out.println();
		System.exit(0);
	}


	public static int findKey1(String s) {
		Keypad pad = new Keypad();
		int column = 1;
		int row = 1;
		char[] cmds = s.toCharArray();
		for (char cmd : cmds) {
			if (cmd == 'U') {
				if (row == 0)
					continue;
				row--;
			}
			else if (cmd == 'D') {
				if (row == 2)
					continue;
				row++;
			}
			else if (cmd == 'R') {
				if (column == 2)
					continue;
				column++;
			}
			else {	//L
				if (column == 0)
					continue;
				column--;
			}
		}
		return pad.getKeyAtPos(column, row);
	}

	public static char findKey2(String s) {
		Keypad2 pad = new Keypad2();
		int c = 1;
		int r = 3;
		char[] cmds = s.toCharArray();
		for (char cmd : cmds) {
			if (cmd == 'U') {
				if (pad.getKeyAtPos(c, r-1) == 0)
					continue;
				r--;
			}
			else if (cmd == 'D') {
				if (pad.getKeyAtPos(c, r+1) == 0)
					continue;
				r++;
			}
			else if (cmd == 'R') {
				if (pad.getKeyAtPos(c+1, r) == 0)
					continue;
				c++;
			}
			else {	//L
				if (pad.getKeyAtPos(c-1, r) == 0)
					continue;
				c--;
			}
		}
		return pad.getKeyAtPos(c, r);
	}

}